import styled from 'styled-components';

const BoxCategory = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  top: -40px;
  background: #F9BA18;
  box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
  border-radius: 100px;
  width: 413px;
  height: 45px;
  letter-spacing: 0.12em;
  color: #FFFFFF;
  font-size: 20px;
`;

export default BoxCategory;
